import React from 'react';
import logo from './logo.svg';
import './App.css';
import { NavLink, BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import principal from './principal';
import { Link } from 'react-router-dom';
import elegir from 'elegir';
function App(){
  return(
    <Router>
      <div className="app">
        <Switch>
          <Route path="/principal" exact component={principal}/>
          <Route path="/" component={Login}/>
          <Route path="/elegir" exact component={elegir}/>
        </Switch>
      </div>
    </Router>
  );
}

   const Login = () => (
<div style={{textAlign: 'center'}}>
    <div>
        <div> Email </div>
        <input id="email" placeholder="Enter Email..." type="text"/>
    </div>
    <div>
        <div> Password</div>
        <input id="password" placeholder="Enter Password..." type="text"/>
    </div>
    <div>
        <div> nombre</div>
        <input id="nombre" placeholder="nombre" type="text"/>
    </div>
    <div>
        <div> apellido</div>
        <input id="apellido" placeholder="apellido" type="text"/>
    </div>
    <div>
        <div> celular</div>
        <input id="celular" placeholder="celular" type="text"/>
    </div>
    <Link to="/elegir" >Registrarse</Link>

    </div>

    );

export default App;
